import React, { useState } from "react";

function AddNumber(props) {
    const [date, setDate] = useState(new Date());
    const tick = () => {
        setDate(new Date());
    };

    return (
        <div className="text">
            <form>
                <h4>wartosc x: </h4>
                <input type="number"></input>
            </form>
        </div>
    );
}

export default AddNumber;
